'''Fishmongers''' are men that run [[fish stall]]s and own [[fishing shops]] on [[Miscellania]] and [[Etceteria]]. One can be found in each of the island's markets.

Fishmongers sell items such as [[small fishing net]]s, [[fishing rod]]s, [[feathers]] and [[bait]]. Their market stalls can also be stolen from at level 42 [[Thieving]] for 42 Thieving [[experience]]. As with all stall owners, if stolen from, they will not trade with the players for approximately 15 minutes. If spoken to, they will call for the nearby level 1 guards to attack.

Stealing from the stall in Miscellania will also decrease your popularity with the citizens of the islands, which in turn makes the [[Managing Miscellania|kingdom management options]] less effective.

However, stealing from the Etceteria stall will not decrease your popularity.

